import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import Sdata from './Sdata';
//console.log(sdata[0].sname);
function ncard(val){
    console.log(val)
 return(
 <Card 
 imgsrc={val.imgsrc}
 title={val.title}
 sname={val.sname}
 link={val.link}
/>)
}
ReactDOM.render(
    <>
    
        <h1 className="heading_style">List of top five web series in 2020</h1> 
       <Card 
             imgsrc={Sdata[0].imgsrc}
             title={Sdata[0].title}
             sname={Sdata[0].sname}
             link={Sdata[0].link}
       />
      Sdata.map(ncard);
      </> ,document.getElementById("root")
);
